import React, { Component } from 'react';
import { faTrashCan } from '@fortawesome/free-solid-svg-icons'
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Tasks</h1>
      <Card
        details="sample task"
      />
    </div>
  );
}

function Card(props){
  return (
    <div className="card">
      <input type="checkbox"></input>
      <text>{props.details}</text>
      <button className='__button'><i class = "fa-solid fa-trash-can"></i>Yea</button>
    </div>
  );
}
export default App;
